import React, { Component } from "react";
import {Col, Row, Container} from "../components/Grid";
import Nav from "../components/Nav";
import OutlineBtn from "../components/DeleteBtn/index.js";
import test from "../images/image_seven.png";
import logo from "../images/logo_2.png";
import ("../pages/home.css");



class Home extends Component {
    render(){
        return(
            <Container>
                <Row >
                <Nav >
                
                    
                        <Col size="sm md lg xl">
                        
                        <a className="navbar-brand" href="/">
                <img src={logo} alt="logo"/> 
                </a>
                </Col>
                <Col size="md"></Col>
                <Col size="offset-md">
                <OutlineBtn style={{alignSelf:"left"}}><i className="fas fa-sign-in-alt">Log-Out</i></OutlineBtn>

                </Col>
                </Nav>
                </Row>
               
                            <div className="test">
                            <Row>
                        <img src={test} style={{marginLeft:150,opacity:"0.7", width:2000, marginTop:100, borderTop:"solid white 10px"}} alt="strawberries"/>
                    </Row>

                </div>
                <Row>
                    <Col size="md"></Col>
                    <Col size="md"></Col>
                </Row>
            </Container>
        )
    }
}

export default Home;
